requirement.content:
наличие  действующей лицензии на осуществление деятельности по производству и техническому обслуживанию (за исключением случая, если техническое обслуживание осуществляется для обеспечения собственных нужд юридического лица или индивидуального предпринимателя) медицинской техники, выданной в соответствии с Положением о лицензировании деятельности по производству и техническому обслуживанию (за исключением случая, если техническое обслуживание осуществляется для обеспечения собственных нужд юридического лица или индивидуального предпринимателя) медицинской техники, утверждённым Постановлением Правительства Российской Федерации от 03 июня 2013 года № 469. Виды работ, составляющих лицензируемый вид деятельности:
- В части технического обслуживания (за исключением случая, если техническое обслуживание осуществляется для обеспечения собственных нужд юридического лица или индивидуального предпринимателя) медицинской техники: 
- контроль технического состояния медицинской техники;   
- периодическое и текущее техническое обслуживание медицинской техники; 
- ремонт медицинской техники.
